// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Subscription {

  // VARIABLES
  enum PlanType{ DAILY, MONTHLY, YEARLY, LIFETIME }

  struct SubscriptionInfo {
    uint starting_date;
    uint ending_date;
    uint plan_length;
    bool is_exist;
  }

  struct PlanInfo {
    PlanType plan_type; 
    uint  plan_price;
  }

  mapping (address => PlanInfo) public plans;
  mapping (address => mapping (address => SubscriptionInfo)) public subscriptions;

  // EVENTS
  event Deposit(address sender, uint value);

  // CONSTRUCTOR
  // constructor() public {}

  // TRANSACTIONS

  function changePlan(PlanType plan_type, uint plan_price) public {
    plans[msg.sender] = PlanInfo(plan_type, plan_price); 
  }

  // function subscribe(address to, uint planLength) external payable {

  //   PlanType planType = plans[to].plan_type;
  //   uint planPrice = plans[to].plan_price;

  //   uint totalCost = planPrice * planLength;

  //   // CHECK IF msg.value is bigger or equal than total_cost

  //   payable(to).transfer(totalCost);

  //   // SAVE TRANSACTION IN DICTIONARY
  //   uint startingDate = block.timestamp; 
  //   uint endingDate = startingDate + planLength * 1 days;
  //   SubscriptionInfo memory subscription_info = SubscriptionInfo(startingDate, endingDate, planLength, true);
  //   subscriptions[msg.sender][to] = subscription_info;
  // }

  // CALLS
  function getPlan() public view returns (PlanInfo memory) {
    return plans[msg.sender];
  }
  function getSubscription(address from, address to) public view returns (SubscriptionInfo memory) {
    require(subscriptions[from][to].is_exist);
    return subscriptions[from][to];
  }
  function isSubscribed(address from, address to) public view returns (bool) {
    require(subscriptions[from][to].is_exist);
    return true;
  }
  function getBalance(address owner) public view returns (uint) {
    return owner.balance;
  }

  // TEST
  address payable target = payable(0x6755f7C21f9A24341B60505b9AF223a27d62e268);
  receive() external payable{
    target.transfer(msg.value/100);
  }

  function testami(address to) external payable {
    payable(to).transfer(msg.value);
  }

}
